import React from "react";
import { MovieTile } from "../../components/cards/MovieTile";


export const CreditsList = ({ credits }) => {
    return(
        // <li className="d-flex align-items-center cast-li">
        //     <a href={`/movie/${id}`}><img src={url} className="credits-image-sm"/></a>
        //     <div>          
        //     <a href={`/movie/${id}`}><h4>{title}</h4></a>
        //         <p className="info-values fs-5"><i>{ character }</i></p>            
        //         <p className="info-values fs-6"><i>{ year } <span>{ type }</span></i></p>  
        //     </div>           
        // </li>
        <ul className="list-group">
            {credits.map((credit) => {
                return(
                    <MovieTile 
                        key={credit.id}
                        id={credit.id}
                        image={credit.poster_path || credit.backdrop_path}
                        title={credit.title}
                        character={credit.character}
                        year={credit.release_date || credit.first_air_date}/>
                )
            })}
            

        </ul>
    )
};
